script: |
  super -f tsv -I q1605.sql | sort > q1605.out

inputs:
  - name: q1605.sql
    data: |
      SELECT col1 / - ( - ( - 63 ) ) * col2 * + - 47 + + col0 + + - ( - col2 ) * 5 - - 46 * + col0 col0, 4 AS col2 FROM tab1 AS cor0;
  - name: tab1

outputs:
  - name: q1605.out
    data: |
      2877	4
      4290	4
      4617	4
